        super(props);
        this.state = {
            search: '',
            contentId: 0, 
        };

        this.handleSearchBarChange.bind(this);
        this.onClickHome.bind(this);
        this.onClickFriends.bind(this);
        this.onClickMessages.bind(this);
        this.onClickNotifications.bind(this);
        this.onClickProfil.bind(this);
